function gb2312decode(str)
{
    var strOut = '';

    try {
        return decodeURIComponent(str);
    } catch(e) {}

    for (var i=0;i<str.length; i++){
        var c = str.charAt(i);
        
        if (c == '+') {
            strOut += ' ';
        } else if (c != '%') {
            strOut += c;
        } else {
            i++;
            var code = str.substr(i,2)+str.substr(i+3,2);
            code = code.toUpperCase();
             i = i + 4;
            if(typeof gbk_table[code] != 'undefined') {
                strOut += gbk_table[code];
            } else strOut += " ";
        }
    }
    return strOut;
}

function decode_links() {
    var regex = /%[\w]{2}%[\w]{2}/;
    var links = document.getElementsByTagName('A');
    for(var i=0;i<links.length;i++) {
        if(links[i].innerHTML.match(regex) != null) links[i].innerHTML = gb2312decode(links[i].innerHTML);
    }
};

document.getElementById('ReportContent').addEventListener("DOMNodeInserted", decode_links, true);
window.addEventListener('load', decode_links, false);
